-- 1. 테이블 생성 (pgvector 확장 필요)
CREATE EXTENSION IF NOT EXISTS vector;

DROP TABLE IF EXISTS design;
CREATE TABLE design (
    id SERIAL PRIMARY KEY,
    title VARCHAR(255) NOT NULL,
    description TEXT NOT NULL,
    embedding vector(384), -- CSV 데이터의 임베딩 차원에 맞게 조정 필요
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

-- 2. 벡터 유사도 검색용 인덱스 생성
CREATE INDEX design_embedding_cosine_idx ON design 
USING hnsw (embedding vector_cosine_ops);

-- 3. 업데이트 트리거 함수 및 트리거 생성
CREATE OR REPLACE FUNCTION update_updated_at_column()
RETURNS TRIGGER AS $$
BEGIN
    NEW.updated_at = CURRENT_TIMESTAMP;
    RETURN NEW;
END;
$$ language 'plpgsql';

CREATE TRIGGER update_design_updated_at 
    BEFORE UPDATE ON design 
    FOR EACH ROW 
    EXECUTE FUNCTION update_updated_at_column();

